import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navigation from './Navigation'; // 네비게이션 컴포넌트 import
import Home from './Menus/Home';
import Story from './Menus/Story';
import Detail from './Menus/Detail';
import Info from './Menus/Info';
import RSVP from './Menus/RSVP';
import Contact from './Menus/Contact';

import { Button, Container, Row } from 'react-bootstrap';


function App() {
  return (
    <Router>
                <Navigation />
     <Container fluid className='App'>
          <Row >          
            {/* <h1> Welcome to Chloe & Charles Wedding </h1> */}
            <Routes>
              <Route path="/" exact element={<Home/>} />
              <Route path="/story" element={<Story/>} />
              <Route path="/detail" element={<Detail/>} />
              <Route path="/info" element={<Info/>} />
              <Route path="/rsvp" element={<RSVP/>} />
              <Route path="/contact" element={<Contact/>} />
            </Routes>
          </Row>
        </Container> 
   </Router>
  );
}

export default App;
